class Submission:
    def __init__(self, submission_id, status, data):
        self.submission_id = submission_id
        self.status = status
        self.data = data

class User:
    def __init__(self, user_id, role):
        self.user_id = user_id
        self.role = role

class FABS:
    submissions = []

    @classmethod
    def upload_submission(cls, submission):
        # Simulate uploading a submission
        cls.submissions.append(submission)
        print(f"Submission {submission.submission_id} uploaded.")

    @classmethod
    def validate_submission(cls, submission):
        # Simulate validation of a submission
        if not submission.data:
            submission.status = "Error: No data"
        else:
            submission.status = "Validated"
        print(f"Submission {submission.submission_id} validated with status: {submission.status}")

    @classmethod
    def publish_submission(cls, submission):
        # Simulate publishing a submission
        if submission.status == "Validated":
            submission.status = "Published"
            print(f"Submission {submission.submission_id} published.")
        else:
            print(f"Submission {submission.submission_id} not published due to validation error.")

class UI:
    def redesign_resources_page(self):
        print("Redesigning Resources page to match new Broker design styles.")

    def report_user_testing(self, agencies):
        for agency in agencies:
            print(f"Reporting user testing results to {agency}.")

    def schedule_user_testing(self):
        print("Scheduling user testing for stakeholders.")

    def create_user_testing_summary(self):
        print("Creating user testing summary from UI SME.")

class Developer:
    def log_activity(self, message):
        print(f"Log: {message}")

    def update_validation_rules(self, changes):
        print("Updating validation rules with changes:", changes)

    def prevent_double_publishing(self):
        print("Preventing users from double publishing submissions.")

class DataUser:
    def process_deletions(self, deletions):
        print("Processing deletions for:", deletions)

class AgencyUser:
    def load_fpds_data(self):
        print("Loading up-to-date FPDS data.")

    def submit_data(self, data):
        print(f"Submitting data for agency: {data}")

class BrokerUser:
    def create_content_mockups(self):
        print("Creating content mockups for data submission.")

class App:
    def __init__(self):
        self.fabs = FABS()
        self.ui = UI()
        self.developer = Developer()
        self.data_user = DataUser()
        self.agency_user = AgencyUser()
        self.broker_user = BrokerUser()

    def run(self):
        # Example of using the classes
        user = User("user1", "Broker")
        submission = Submission("submission1", "Pending", {"data": "sample_data"})

        self.fabs.upload_submission(submission)
        self.fabs.validate_submission(submission)
        self.fabs.publish_submission(submission)

        self.ui.redesign_resources_page()
        self.ui.report_user_testing(["Agency A", "Agency B"])
        self.ui.schedule_user_testing()
        self.ui.create_user_testing_summary()

        self.developer.log_activity("User tested FABS submission.")
        self.developer.update_validation_rules({"rule_change": "DB-2213"})
        self.developer.prevent_double_publishing()

        self.data_user.process_deletions(["12-19-2017 deletions"])
        self.agency_user.load_fpds_data()
        self.agency_user.submit_data({"data": "financial_assistance_data"})
        self.broker_user.create_content_mockups()

if __name__ == "__main__":
    app = App()
    app.run()
